Storyline


This film, based on Lois Lowry's book, tells the story of a perfect world. Everyone here is happy. When Jonas is 18 years old, he's chosen to be the community's Receiver of Memories. He enters into training with an old man called The Giver. From the Giver, Jonas learns about pain, sadness, war, and all the unhappy truths of the &quot;real&quot; world. He quickly realizes that his community is fake. Confronted with this reality, Jonas faces difficult choices about his own life and his future.


